settings.getEngineStatus:
var good=0;
var moderate=0; 
var bad=0;
widgetContext.datasources.forEach(function(e){
    var powerLoss=widgetContext.data.find(d=>d.dataKey.name=="PowerLoss_valueInPercent" && e.entityId==d.datasource.entityId)
    var mechanicalHealth=widgetContext.data.find(d=>d.dataKey.name=="MechanicalHealth_valueInPercent" && e.entityId==d.datasource.entityId)
    var engineEfficiency=widgetContext.data.find(d=>d.dataKey.name=="EngineEfficiency_valueInPercent" && e.entityId==d.datasource.entityId)
    if(powerLoss !==undefined && mechanicalHealth !==undefined && engineEfficiency !==undefined){
        var powerLossValue=powerLoss.data[0][1]
        var mechanicalHealthValue=mechanicalHealth.data[0][1]
        var engineEfficiencyValue=engineEfficiency.data[0][1]
        if(mechanicalHealthValue<30 && engineEfficiencyValue<30 && powerLossValue>4){
            bad=bad+1
        }
        else if(mechanicalHealthValue<30 || engineEfficiencyValue<30 || powerLossValue>4){
            moderate=moderate+1
        }
        else{
            good=good+1
        }
    }
})
// return {good:2,moderate:0,bad:2}
return {good:good,moderate:moderate,bad:bad}

